import { BaseResourceModel } from "./base-resource.model";
export class Ceps extends BaseResourceModel {
  constructor(id, cep, numeroIni, numeroFin, identificacao, bairrosId, bairros, logradourosId, logradouros) {
    super();
    this.id = id;
    this.cep = cep;
    this.numeroIni = numeroIni;
    this.numeroFin = numeroFin;
    this.identificacao = identificacao;
    this.bairrosId = bairrosId;
    this.bairros = bairros;
    this.logradourosId = logradourosId;
    this.logradouros = logradouros;
  }
  static fromJson(jsonData) {
    const ceps = {
      ...jsonData,
      bairrosId: jsonData["bairros"]["id"],
      logradourosId: jsonData["logradouros"]["id"]
    };
    return Object.assign(new Ceps(), ceps);
  }
  static toJson(obj) {
    return Object.assign(new Ceps(), obj);
  }
}
